import React, { useState, useEffect } from "react";
import { PieChart, Pie, Cell, Tooltip, ResponsiveContainer } from "recharts";
import { performAnalysis } from "./AnalysisGet";

const AnalysisDisplay = () => {
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setAnalysisResults(results);
      } catch (err) {
        setError(err);
      }
    };

    fetchData();
  }, []);

  if (error) {
    console.error("Error fetching analysis data:", error);
  }

  if (!analysisResults && !error) {
    return <div>Loading...</div>;
  }

  const { averageWin = 0, averageLoss = 0 } = analysisResults || {};
  const total = averageWin + averageLoss;
  const winPercent = total > 0 ? (averageWin / total) * 100 : 50;

  // Data for PieChart
  const data = [
    {
      name: "Average Win",
      value: winPercent,
      color: "#4a90e2",
      amount: averageWin,
    },
    {
      name: "Average Loss",
      value: 100 - winPercent,
      color: "#f44336",
      amount: averageLoss,
    },
  ];

  return (
    <div
      className="analysis-display-container"
      style={{ width: "150px", margin: "0 auto" }}
    >
      <ResponsiveContainer width="100%" height={150}>
        <PieChart>
          <Pie
            data={data}
            innerRadius={50}
            outerRadius={70}
            dataKey="value"
            startAngle={90}
            endAngle={-270}
            stroke="none"
          >
            {data.map((entry, index) => (
              <Cell
                key={`cell-${index}`}
                fill={entry.color}
                style={{
                  transition: "filter 0.3s",
                  filter: "none", // No glow initially
                  cursor: "pointer",
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.filter = `drop-shadow(0 0 15px ${entry.color})`;
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.filter = "none"; // Remove glow on mouse leave
                }}
              />
            ))}
          </Pie>
          <Tooltip
            cursor={false} // Disable the default hover cursor effect
            formatter={(value, name, props) => {
              const { payload } = props;
              return [`$${payload.amount.toFixed(2)}`, payload.name];
            }}
          />
        </PieChart>
      </ResponsiveContainer>
    </div>
  );
};

export default AnalysisDisplay;

